import React from 'react';
import './ContentPanel.css';

var bgColors = { 
                    "Orange": "#EA8D4E",
                    "Red": "#E46765",
                    "Blue": "#3E99CD",
                    "Navy": "#4A637B",
                    "Purple": "#807798",
                    "Pink": "#D46E8F"
};

const Skills = React.forwardRef((props, ref)=>{

    return (
        <div className='box3'>
            <div className='content'>
                <div data-aos='fade-in' className='sectionHeader'>Skills</div>
                <div className='whiteSpace'></div>
            </div>
            <div className='moreSpace'></div>
            <div data-aos="zoom-out" data-aos-duration="3000" className='dot'></div>
            <div data-aos="zoom-out" data-aos-duration="2000" className='dot'></div>
            <div data-aos="zoom-out" data-aos-duration="2000" className='dot'></div>
            <div data-aos="zoom-out" className='skill' style={{backgroundColor: bgColors.Orange}}>React</div>
        </div>
    )
}) 
export default Skills;
